package cn.lily.leetcode;

import java.util.Arrays;
import java.util.LinkedList;
import java.util.List;

public class Test438 {
    public static LinkedList<String> possibleStr = new LinkedList<>();
    public static void Permutation(String p){
        if (p == null || p.length() < 1){
            return;
        }
        LinkedList<Character> chars = new LinkedList<>();
        for(int i = 0; i < p.length(); i++){
            chars.add(p.charAt(i));
        }
        String temp = "";
        permuteCur(p, chars, 0, temp);
    }
    public static void permuteCur(String p, LinkedList<Character> chars, int start, String temp){
        if (start == p.length()){
            possibleStr.add(temp);
        }
        for (int i = 0; i < chars.size(); i++) {
            boolean flag = false;
            for (int j = 0; j < i; j++){
                if (chars.get(j) == chars.get(i)){
                    flag =true;
                    break;
                }
            }
            if (flag){
                continue;
            }
            char tempChr = chars.remove(i);
            permuteCur(p, chars, start + 1, temp + tempChr);
            chars.add(i, tempChr);
        }
    }
    public static List<Integer> findAnagrams(String s, String p){
        Permutation(p);
        List<Integer> result = new LinkedList<>();
        for (int i = 0; i <= s.length() - p.length(); i++) {
                String temp = s.substring(i, i + p.length());
                if (possibleStr.contains(temp)){
                    result.add(i);
                }
        }
        return result;
    }
    public static List<Integer> findAnagrams1(String s, String p){
        List<Integer> result = new LinkedList<>();
        LinkedList<Character> chars = new LinkedList<>();
        for(int i = 0; i < p.length(); i++){
            chars.add(p.charAt(i));
        }
        if (s.length() - chars.size() < 0){
            return result;
        }
        int i = 0, j = i;
        LinkedList<Character> temp = new LinkedList<>();
        while (i < s.length() - chars.size() + 1){
            j = i;
            temp.clear();
            temp.addAll(chars);
            while (!temp.isEmpty() && j < s.length()){
                if(temp.contains(s.charAt(j))){
                    temp.removeFirstOccurrence(s.charAt(j));
                } else {
                    break;
                }
                j++;
            }
            if (temp.isEmpty()){
                result.add(i);
            }
            i++;
        }
        return result;
    }
    public static List<Integer> findAnagrams2(String s, String p){
        List<Integer> result = new LinkedList<>();
        int[] chars = new int[26];
        for (int i = 0; i < p.length(); i++) {
            chars[p.charAt(i) - 'a']++;
        }
        for (int i = 0; i < s.length() - p.length() + 1; i++) {
            String temp = s.substring(i,i + p.length());
            int[] charsCopy = chars.clone();
            int j;
            for (j = 0; j < temp.length(); j++) {
                if (charsCopy[temp.charAt(j) - 'a'] > 0){
                    charsCopy[temp.charAt(j) - 'a']--;
                }  else {
                    break;
                }
            }
            if (j == temp.length()){
                result.add(i);
            }
        }
        return result;
    }
    public static void main(String[] args) {
        String s = "";
        String p = "";
       // Permutation(p);
       // System.out.println(possibleStr);
        System.out.println(findAnagrams2(s, p));
    }
}
